data Lexeme = L AlexPosn LexemeClass String deriving Show

data LexemeClass
  = LInteger
  | LFloat
  | LChar
  | LString
  | LSpecial
  | LReservedId
  | LReservedOp
  | LVarId
  | LQVarId
  | LConId
  | LQConId
  | LVarSym
  | LQVarSym
  | LConSym
  | LQConSym
  | LEOF
  deriving (Eq,Show)

mkL :: LexemeClass -> AlexInput -> Int -> Alex Lexeme
mkL c (p,_,_,str) len = return (L p c (take len str))

nested_comment :: AlexInput -> Int -> Alex Lexeme
nested_comment _ _ = do
  input <- alexGetInput
  go 1 input
  where
  go 0 input = do alexSetInput input; alexMonadScan
  go n input = do
    case alexGetByte input of
      Nothing  -> err input
      Just (c,input) -> do
        case chr (fromIntegral c) of
          '-' -> do
            case alexGetByte input of
              Nothing  -> err input
              Just (125,input) -> go (n-1) input
              Just (c,input)   -> go n input
          '\123' -> do
            case alexGetByte input of
              Nothing  -> err input
              Just (c,input) | c == fromIntegral (ord '-') -> go (n+1) input
              Just (c,input)   -> go n input
          c -> go n input

  err input = do alexSetInput input; lexError "error in nested comment"  

lexError s = do
  (p,c,_,input) <- alexGetInput
  alexError (showPosn p ++ ": " ++ s ++ 
          (if (not (null input))
           then " before " ++ show (head input)
           else " at end of file"))

scanner str = runAlex str $ loop 0
  where
  loop i = do
    tok@(L _ cl _) <- alexMonadScan; 
    if cl == LEOF
    then return (i,[])
    else do (i',ts) <- loop $! (i+1)
            return (i',tok:ts)

alexEOF = return (L undefined LEOF "")

showPosn (AlexPn _ line col) = show line ++ ':': show col

main :: IO ()
main = getContents >>= print . scanner


